import React from 'react';
import userIcon from '../assets/user.svg';
import lockIcon from '../assets/lock.svg';
import clockIcon from '../assets/clock.svg';

const WhyDrop2Fill = () => {
  return (
    <section className="py-16 bg-white text-center">
      <div className="container mx-auto">
        <h2 className="text-3xl font-bold mb-8">Why Drop2Fill?</h2>
        <div className="grid grid-cols-1 sm:grid-cols-3 gap-8">
          <div className="flex flex-col items-center">
            <img src={userIcon} alt="User-friendly Interface" className="w-12 h-12 mb-4" />
            <h3 className="text-xl font-semibold">User-friendly Interface</h3>
            <p className="mt-2 text-gray-600">Designed with simplicity in mind, Drop2Fill is intuitive and easy to use, whether you prefer dark mode or light mode.</p>
          </div>
          <div className="flex flex-col items-center">
            <img src={lockIcon} alt="Secure and Private" className="w-12 h-12 mb-4" />
            <h3 className="text-xl font-semibold">Secure and Private</h3>
            <p className="mt-2 text-gray-600">Your data is stored locally on your device. We prioritize your privacy and ensure that your information is secure.</p>
          </div>
          <div className="flex flex-col items-center">
            <img src={clockIcon} alt="Time-saving" className="w-12 h-12 mb-4" />
            <h3 className="text-xl font-semibold">Time-saving</h3>
            <p className="mt-2 text-gray-600">Say goodbye to hours of repetitive work. Drop2Fill helps you in the application process, so you can focus on what matters most.</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default WhyDrop2Fill;
